policy-map core-egress-queuing
 class match-traffic-class-2
  priority level 2 
  queue-limit 100 us 
 ! 
 class match-traffic-class-3
  priority level 3 
  queue-limit 500 us 
 ! 
 class match-traffic-class-6
  priority level 6 
  queue-limit 500 us 
 ! 
 class match-traffic-class-1
  priority level 1 
  queue-limit 500 us 
 ! 
 class class-default
  queue-limit 250 ms 
 ! 
 end-policy-map
! 
policy-map core-egress-exp-marking
 class match-qos-group-1
  set mpls experimental imposition 6
 ! 
 class match-qos-group-2
  set mpls experimental imposition 5
 ! 
 class match-qos-group-3
  set mpls experimental imposition 4
 ! 
 class match-qos-group-6
  set mpls experimental imposition 2
 ! 
 class class-default
  set mpls experimental imposition 0
 ! 
 end-policy-map
! 
policy-map core-ingress-classifier
 class match-cs6-exp6
  set traffic-class 1
 ! 
 class match-ef-exp5
  set traffic-class 2
 ! 
 class match-cs5-exp4
  set traffic-class 3
 ! 
 class match-video-cs4-exp2
  set traffic-class 6
 ! 
 class class-default
  set mpls experimental topmost 0
  set traffic-class 0
  set dscp 0
 ! 
 end-policy-map
! 
policy-map core-egress-queuing-hqos
 class match-traffic-class-2
  priority level 2 
  queue-limit 100 us 
 ! 
 class match-traffic-class-3
  priority level 3 
  queue-limit 500 us 
 ! 
 class match-traffic-class-6
  priority level 4 
  queue-limit 500 us 
 ! 
 class match-traffic-class-1
  priority level 1 
  queue-limit 500 us 
 ! 
 class class-default
  queue-limit 250 ms 
 ! 
 end-policy-map
